import React from 'react'
import { Link } from 'react-router-dom'

function Header() {
    return (
        <header  style={headerStyle}>
            <h1>Todo List </h1>
            <Link style={linkStyle} to="/"></Link> | <Link to="/about"></Link>
        </header>
    )
}

const headerStyle = {
    background: '#333',
    color: '#fff',
    padding: '10px',
    textAlign: 'center'
}

const linkStyle = {
    color: '#fff',
    textDecoration: 'none'
}

export default Header;
